import React ,{ Component } from "react";
import Link from "next/link";
import fetch from 'isomorphic-fetch';
import Layout from "../Components/Layout";


class Home extends Component{
    constructor()
    {
        super();
        this.state={
            data:[],
        }
    }
    componentDidMount()
    {
        fetch('http://localhost:50607/api/item')
        .then(res => res.json())
        .then((findres) => {
            console.log(findres);
        this.setState({
            data:findres,
        })
    });
    }
    render()
    {
        return(
        <Layout>
            <div>
                <h1>Hello Steritrack</h1>
                
            </div>
            </Layout>
        );
    }
}

export default Home;
